                                            <Nav.Link eventKey="first">Tech Skills</Nav.Link>
                                        </Nav.Item>
                                        <Nav.Item>
                                            <Nav.Link eventKey="second">Soft Skills</Nav.Link>
                                        </Nav.Item>
                                    </Nav>
                              <Col>
                              <Tab.Content>
                                        <Tab.Pane eventKey="first">
                                            <Row>
                                                {
                                                    projects.map((project, index) => {
                                                        return (
                                                            <ProjectCard key={index}
